    "migration-chronology-and-management-of-waterbirds-at-stillwater-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "The Lahontan Valley wetlands and associated
    Stillwater National Wildlife Refuge (NWR) play an important role in the maintenance
    and migration of several species of waterbirds. Recently listed as a hemispheric
    site under the Western Hemispheric Shorebird Reserve Network (WHSRN 1992), Stillwater
    NWR and Carson Lake host np to 80% of the Pacific flyway, long-billed dowitcher
    population and generally> I00,000 total shorebirds (Neel and Henry 1996). In addition,
    several other waterbird groups including waterfowl, wading birds, grebes, pelicans,
    gulls, terns, and other migratory and nonmigratory species use the wetlands. Among
    groups, shorebirds, waterfowl, and colonial nesting species such as waders have
    been widely censused through both aerial flights (waterfowl; Nevada division of
    Wildlife monthly surveys; colonial nesting waterbirds; Nevada Division of Wildlife
    annual breeding survey) and coordinated ground censuses (shorebirds; in conjunction
    with the Point Reyes Bird Observatory counts). While useful in documenting total
    populations within the Lahontan Valley, they fail to capture annual migration chronologies
    useful in determining beneficial wetland management strategies. Furthermore, these
    one time counts often fail to capture peak populations as migration is typically
    staggered throughout several months and do not census populations of waterbirds
    other than waterfowl, shorebirds, and waders. This monitoring effort was conducted
    to fill this need by documenting chronological patterns of use by a variety of species
    every two weeks over the annual cycle. Specific objectives include:  l. To provide
    species specific chronological use information throughout the life history cycle
    of waterbird species utilizing Stillwater NWR  2. To relate this information to
    habitat management, providing potential strategies related to different periada
    of use and life history requirements",nt"license_title": "License Not Specified",nt"extras":
